        # return rotations

        ##### ONLY LOOKS AT PERSPECTIVE OF A OR B AND NOT B TO MATCH A #####
        # optionA = A[0]
        # optionB = B[0]
        # rotationsA = 0
        # rotationsB = 0
        # passA = True
        # passB = True

        # for i in range(len(A)):
